# In[2]:


from understanding_data import *


# In[3]:


training_dataset


# In[4]:


testing_dataset


# ## Training of SVM classifier
# 
# First, we load the dataset and train the classifier. For this tutorial, 
#  we only consider 2 digits,  0 (zero) and 4 (four).

# SVM is considered one of the most used ML algorithm in classification. Its application is widely known in spam detection, image classification, malware detection. Its main ability is in differentiating linear data as well as non-linear data, i.e by kernelisation.
# 
# In the below diagram, we have 2-D data plot, SVM can easily differentiate this kind of linear data as shown in the plot.
# 
# ![Untitled Diagram.drawio.png](data:image/png;base64,)
# 
# What if the data is mixed up and not linear?
# 
# ![mixed.png](data:image/png;base64,)
# 
# In these case SVM is of rescue. It has a property called Kernelisation, that transforms the dimension of data for easy and faster classification.
# 
# ![kernel.png](data:image/png;base64,)

# In[5]:


from secml.ml.classifiers import CClassifierSVM # We are using the secml SVM Classifier, which is based on scikit SVM classifier


# In[6]:


model = CClassifierSVM(kernel='linear') # We will use a linear classifier in this case
# Kernel RBF can also be used, which is a non-linear classifier


# In[7]:


model.fit(training_dataset.X, training_dataset.Y)
# We are training our model with the training dataset
# As this is supervised learning, we give the datapoints(X) along with output labels(Y).


# ## Performance Evaluation
# ### Once a machine learning model is trained, we test its performance on a testing dataset, i.e the dataset that the model is unique to.
# ### We predict the output by passing the testing dataset to the model, and compare with the true outputs.
# 

# In[8]:


y_prediction = model.predict(testing_dataset.X)


# In[9]:


from secml.ml.peval.metrics import CMetricAccuracy
metric = CMetricAccuracy()


# In[10]:


accuracy_score = metric.performance_score(y_true=testing_dataset.Y, y_pred=y_prediction)


# In[11]:


print("Accuracy on testing dataset: {:.2%}".format(accuracy_score))


